USE chiumdev;

CREATE TABLE `PROSPECTIVE_MEMBERS` (
  `ID` bigint NOT NULL AUTO_INCREMENT,
  `COMP_NAME` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `REP_NAME` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `CONTACT` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `FAX` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `EMAIL` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `BIZ_CODE` varchar(4) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `WEBSITE` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `BCODE` varchar(10) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `ADDR` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `LAT` decimal(12,9) DEFAULT NULL,
  `LNG` decimal(12,9) DEFAULT NULL,
  `NOTE` text COLLATE utf8mb4_unicode_ci,
  `IS_TRANSIT` tinyint DEFAULT NULL,
  PRIMARY KEY (`ID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci COMMENT='가망회원리스트';


